import React, { useState } from "react";
import axios from "axios";

const TestPage = () => {
  const [data, setData] = useState({});
  axios
    .get("api/hello")
    .then((response) => {
      console.log(response);
      setData(response.data);
    })
    .catch((err) => {
      console.log(err);
    }, []);
  return <div>TestPage</div>;
};

export default TestPage;
